#Fenwick Tree Class OR 2D-BINARY TREE
class FenwickTree:
    def __init__(self,array,n):
        self.array=array
        self.array.insert(0, 0)
        self.n=n
        #creating Binary_Tree Array Of Given Array
        self.bint = [0 for i in range(len(self.array)+1)]   
        for index in range(1, self.n+1):
            self.update(index,self.array[index])
    def update(self,index, value):
        index=int(index)
        value=int(value)
        print(index)
        while index < len(self.array):
            self.bint[index] += value
            index += index & -index    
        return self.bint    
    def prefixSum(self,index):
        print(index)
        index=int(index)
        if index < 1: raise Exception("Invalid index, must be at least 1")
        if index > len(self.bint): raise Exception("Index out of bounds exception")
        summ = 0
        while index > 0:
            summ += self.bint[index-1]
            index -= index & -index
        return summ 
    def RangeSum(self,start,stop):
        start=int(start)
        stop=int(stop)
        result = self.prefixSum(stop)
        if start > 0:
            result -= self.prefixSum(start)
        return result
    def __getitem__(self, idx):
        return self.RangeSum(idx, idx + 1)
